
public class FbExample {
	
	static int fb() {
		int i,j,count;
		count=0;
		for(i=0; i<5;i++); {
			//count++;
			for(j=0;j<5;j++); {
				count++;
			}
		}
		
		System.out.println(count);
		return 0;

	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		fb();
		
	}

}
